import React from 'react';

const person = (props) => {
  return (
    <div>
      <p>
        I will learn React anyhow! {<br />}
        I am {props.name} and am {props.age} years old!
      </p>
      <p onClick={props.click}>{props.children}</p>
      <input onChange={props.change} />
    </div>
  );
};

export default person;
